import styled from './Meals.module.css'
const Meals = (props) => {
    return (
        <ul className={styled.meals-container}>
           {props.meals.map(meal => {
          return  <li>{meal.name} {meal.description} {meal.price}</li>
           })}
        </ul>
    )
}
export default Meals
